Ako vykonať meranie kyslíka v krvi:
1. Hodinky si nasaďte na šírku jedného prsta pod zápästnou kosťou a noste ich v pohodlnej polohe na zápästí; 
2. Po vstupe do režimu detekcie kyslíka v krvi zostaňte v pokoji, uistite sa, že vaše zápästie je v rovine a hodinky smerujú nahor. Ak sedíte, môžete si položiť ruky na stôl tak, aby hodinky smerovali nahor; 
3. Držte ruku v pokoji, kým sa nezobrazí konečný výsledok. Upozorňujeme, že táto funkcia je experimentálna, hodnoty sú len odhadované a môžu sa líšiť od skutočnosti. Táto funkcia nie je určená na lekárske použitie. Ak máte akékoľvek otázky týkajúce sa vášho zdravotného stavu, obráťte sa na odborníka alebo svojho lekára.
